import React from 'react';
import { Link } from 'react-router-dom';

export default function ArticleNavgation() {
    return (
        <div>
        <div className="article_navigation">
            <span className="logo"></span>
        </div>
        <div className="article_sub_navigation">
            <ul>
                <li id="selected">HOT 10</li>
                <li>Latest</li>
                <li>Nutrition</li>
                <li>Health</li>
                <li>Beauty</li>
            </ul>
        </div>
    </div>
    )

}
